def makedata(headers, features_hdfs):

    features_new = {}

    for i in range(len(headers)):
        new = {}
        schema = attributes_to_schema(headers[i])

        data = spark.read.schema(schema).csv(features_hdfs[i])
        #data.show(1, False)
        
        name = features_hdfs[i].\
               lstrip('hdfs:///data/msd/audio/features/').rstrip("-v1.0.csv")
        
        new[name] = data

        features_new.update(new)

    return features_new

